import Newsitem from "./Newsitem";

export default class News extends Component{
  render(){
    return (
      <div>
        This is news component
        <Newsitem className="my-3 mx-10" title="myTitle" desc="myDescription"/>
        <Newsitem className="my-3"/>
        <Newsitem className="my-3"/>
        <Newsitem className="my-3"/>
        <Newsitem className="my-3"/>
      </div>

    )
  }
}
